import React from 'react';

const DisplayProfile = ({ profileData, setEditOption }) => {
    return (
        <div>
            <button onClick = { e => setEditOption(true)}>Edit Profile</button> <br></br>
            Name : {profileData.name} <br />
            Contact : {profileData.phone} <br />
            Address : {profileData.address} <br />
        </div>
    )
}

export default DisplayProfile;
